import React from "react";
import "./style.css";

import {CssBaseline, Tooltip, IconButton, Box, Grid, Paper} from '@mui/material';
import { styled } from '@mui/material/styles';
import LogoutIcon from '@mui/icons-material/Logout';

const Item = styled(Paper)(({ theme }) => ({
  backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: 'center',
  color: theme.palette.text.secondary,
}));

function App() {

  const handleLogOut = async () => {
    console.log("log out clicked");
    const fetchReq = await fetch("/api/logout", {
      method: "DELETE",
  });
    const response = await fetchReq.json();
    if (response.success === true) {
      // eslint-disable-next-line no-restricted-globals
      location.reload();
  }
    return
  }

  return (
    <> <CssBaseline />
              <Tooltip title="Log Out">
            <IconButton onClick={()=>handleLogOut()}>
              <LogoutIcon sx={{ color: "#c22c2d" }} />
            </IconButton>
          </Tooltip>

    <Box sx={{ flexGrow: 1 }}>
      <Grid container spacing={3}>
        <Grid xs={6} md={8}>
          <Box sx={{ bgcolor: 'primary.main' }}>xs=6 md=8</Box>
        </Grid>
        <Grid xs={6} md={4}>
          <Box sx={{ bgcolor: 'secondary.main' }}>xs=6 md=4</Box>
        </Grid>
        <Grid xs={6} md={4}>
          <Box sx={{ bgcolor: 'primary.main' }}>xs=6 md=4</Box>
        </Grid>
        <Grid xs={6} md={8}>
          <Box sx={{ bgcolor: 'secondary.main' }}>xs=6 md=8</Box>
        </Grid>
      </Grid>
    </Box>
    </>
  );
}

export default App;
